webpackJsonp([0xe3fb4ee8988c],{2916:function(n,a){n.exports={pathContext:{docHtml:'<h2>Script</h2>\n<p>NAN provides a <code>v8::Script</code> helpers as the API has changed over the supported versions of V8.</p>\n<ul>\n<li><a href="#api_nan_compile_script"><b><code>Nan::CompileScript()</code></b></a></li>\n<li><a href="#api_nan_run_script"><b><code>Nan::RunScript()</code></b></a></li>\n</ul>\n<p><a name="api_nan_compile_script"></a></p>\n<h3>Nan::CompileScript()</h3>\n<p>A wrapper around <a href="https://v8docs.nodesource.com/io.js-3.3/da/da5/classv8_1_1_script_compiler.html#a93f5072a0db55d881b969e9fc98e564b"><code>v8::Script::Compile()</code></a>.</p>\n<p>Note that <code>Nan::BoundScript</code> is an alias for <code>v8::Script</code>.</p>\n<p>Signature:</p>\n<pre><code class="language-c++">Nan::MaybeLocal&#x3C;Nan::BoundScript> Nan::CompileScript(\n    v8::Local&#x3C;v8::String> s,\n    const v8::ScriptOrigin&#x26; origin);\nNan::MaybeLocal&#x3C;Nan::BoundScript> Nan::CompileScript(v8::Local&#x3C;v8::String> s);\n</code></pre>\n<p><a name="api_nan_run_script"></a></p>\n<h3>Nan::RunScript()</h3>\n<p>Calls <code>script->Run()</code> or <code>script->BindToCurrentContext()->Run(Nan::GetCurrentContext())</code>.</p>\n<p>Note that <code>Nan::BoundScript</code> is an alias for <code>v8::Script</code> and <code>Nan::UnboundScript</code> is an alias for <code>v8::UnboundScript</code> where available and <code>v8::Script</code> on older versions of V8.</p>\n<p>Signature:</p>\n<pre><code class="language-c++">Nan::MaybeLocal&#x3C;v8::Value> Nan::RunScript(v8::Local&#x3C;Nan::UnboundScript> script)\nNan::MaybeLocal&#x3C;v8::Value> Nan::RunScript(v8::Local&#x3C;Nan::BoundScript> script) \n</code></pre>',docPath:"argo-ci/node_modules/nan/doc/script",proj:"argo-ci"}}}});
